import styled from "styled-components";
import Button from '@mui/material/Button';

const Box = styled.div`

    margin-left: 500px;
`




function Btn() {

    return(
        <Box>
        <Button size="small" variant="contained">Modelos</Button>
        <Button size="small" variant="contained">Usuarios</Button>
        <Button size="small"variant="contained">Gráficos</Button>
        </Box>
    )

}

export default Btn;
